            const sum = arr.reduce((accumulator, currentValue) => accumulator + currentValue, 0);

        function CreateImage3D(array, positions, scene) {
            var lenx = array.length;
            var leny = array[0].length;
            var lenz = array[0][0].length;
            const ImageCubes = [];
            for (var x = 0; x < array.length; x++) {
                for (var y = 0; y < array[x].length; y++) {
                    for (var z = 0; z < array[x][y].length; z++) {
                        // console.log("Here")
                        var color = array[lenx - x - 1][y][z];
                        var position = [(z - leny / 2) * spacing + positions[0], (-y + leny / 2 + 14) * spacing + positions[1], (x) * spacing];
                        // console.log(position)
                        ImageCubes.push(createCube(color, position));
                        // console.log(ImageCubes[ImageCubes.length - 1].position);
                        scene.add(ImageCubes[ImageCubes.length - 1]);
                    }
                }
            }
            return ImageCubes;
        }

        function createSceneA(containerId) {
            const scene = new THREE.Scene();
            const renderer = new THREE.WebGLRenderer();
            renderer.setSize(window.innerWidth, window.innerHeight);

            const container = document.getElementById(containerId);
            container.appendChild(renderer.domElement);

            const camera = new THREE.PerspectiveCamera(75, window.innerWidth / (innerHeight), 0.1, 1000);
            camera.position.z = 155;
            scene.background = new THREE.Color(0x000125);
            scenes.push(scene);
            renderers.push(renderer);
            cameras.push(camera);
        }

        function createSceneB(containerId, size = 1) {
            const scene = new THREE.Scene();
            const renderer = new THREE.WebGLRenderer();
            renderer.setSize((window.innerWidth / 4) * size, window.innerHeight / 2);

            const container = document.getElementById(containerId);
            container.appendChild(renderer.domElement);

            const camera = new THREE.PerspectiveCamera(75, window.innerWidth * size / (2 * innerHeight), 0.1, 1000);
            camera.position.z = 155;

            scenes.push(scene);
            renderers.push(renderer);
            cameras.push(camera);
        }

        function grayscaleToHex(value) {
            // Clamp the value to the range [0, 1]
            value = Math.max(0, Math.min(1, value));
            // Convert the value to a hexadecimal string
            const hexValue = Math.round(value * 255).toString(16).padStart(2, '0');
            return `#${hexValue}${hexValue}${hexValue}`; // Return the hex color code
        }
        function grayscaleToHex2(value) {

            // value = Math.max(0, Math.min(1, value));
            // Convert the value to a hexadecimal string

            return `#${hexValue}${hexValue}${hexValue}`; // Return the hex color code

            for (var i = 0; i < 3; i++) {
                for (var j = 0; j < 3; j++) {
                    for (var k = 0; k < depth; k++) {
                        sum += (img3d[k][x - 1 + i][y - 1 + j]) * (ker3d[k][2 - i][j]);
                    }
                }
            }
            if (sum < 0) {
                return 0;
            } else {
                return sum;
            }

                                kernelcubes[(i * kernel_size + j) * lenz + z].position.set((j + y - leny / 2) * spacing, (- i - x) * spacing + basePosition.y, (z) * spacing);

        function conv(img3d, ker3d, bias) {
            var lenz = img3d.length;
            var lenx = img3d[0].length;
            var leny = img3d[0][0].length;
            // console.log(lenz,lenx,leny);
            var max = 0;
            var min = NaN;
            var arr = [];
            for (var i = 1; i < lenx - 1; i++) {
                arr[i - 1] = [];
                for (var j = 1; j < leny - 1; j++) {
                    arr[i - 1][j - 1] = MatDot(i, j, lenz, img3d, ker3d) + bias;
                    if (arr[i - 1][j - 1] < 0) {
                        arr[i - 1][j - 1] = 0;
                    }
                    if (arr[i - 1][j - 1] > max) {
                        max = arr[i - 1][j - 1];
                    }
                    if (arr[i - 1][j - 1] < min || isNaN(min)) {
                        min = arr[i - 1][j - 1];
                    }
                    // console.log(arr[i-1][j-1]);
                }
            }
            for (var i = 1; i < lenx - 1; i++) {
                // arr[i-1]=[];
                for (var j = 1; j < leny - 1; j++) {
                    arr[i - 1][j - 1] = ((arr[i - 1][j - 1] - min) / (max - min));
                    // console.log(((arr[i-1][j-1]) ));
                }
            }
            return arr;
        }

        async function animateMaxPool3D(array, pool_size, spacing, ImageCube, scene, showAnimation = true) {
            // Dimensions of the input array
            var lenz = array.length;
            var lenx = array[0].length;
            var leny = array[0][0].length;
            const ResultCubes = [];
            const poolCubes = [];
            var basePosition = ImageCube[0].position;
            var pooled = []
            // Create cubes to visualize the pooling regions
            for (let i = 0; i < lenz; i++) {
                pooled[i] = [];
                for (let j = 0; j < Math.floor(lenx / 2); j++) {
                    pooled[i][j] = [];
                    for (let k = 0; k < Math.floor(leny / 2); k++) {
                        pooled[i][j][k] = 0;
                    }
                }
            }
            if (showAnimation) {
                for (var z = 0; z < lenz; z++) {
                    for (var x = 0; x < pool_size; x++) {
                        for (var y = 0; y < pool_size; y++) {
                            var geometry = new THREE.BoxGeometry();
                            const material = new THREE.MeshBasicMaterial({ color: 0xff0000 }); // Red color for pooling regions
                            poolCubes.push(new THREE.Mesh(geometry, material));
                            poolCubes[poolCubes.length - 1].position.set(0, 0, 0);
                            scene.add(poolCubes[poolCubes.length - 1]);
                            // console.log(basePosition);
                        }
                    }
                }
            }
            for (var x = 0; x < lenx - pool_size + 1; x += pool_size) {
                for (var y = 0; y < leny - pool_size + 1; y += pool_size) {
                    for (var z = 0; z < lenz; z++) {
                        var max = -Infinity;
                        for (var i = 0; i < pool_size; i++) {
                            for (var j = 0; j < pool_size; j++) {
                                max = Math.max(max, array[z][x + i][y + j]);
                                if (showAnimation) {
                                    poolCubes[(i * pool_size + j) * lenz + z].position.set((j + y - leny / 2) * spacing, (- i - x) * spacing + basePosition.y, (z) * spacing);
                                }
                                // poolCubes[(i * pool_size + j) * lenz + z].position.set((j + y - leny / 2) * spacing, (- i - x) * spacing + basePosition.y, (z) * spacing);
                            }
                        }
                        pooled[z][x / 2][y / 2] = max;
                        if (showAnimation) {
                            var position = [(y / 2 + lenx / 4) * spacing + basePosition.x, (- 5 - x / 2 - leny) * spacing + basePosition.y, (z) * spacing];
                            // var position = [(y- (leny - pool_size + 1) / 2) * spacing, ( (lenx - pool_size + 1) / 2-leny-5-x) * spacing, 0];
                            ResultCubes.push(createCube(max, position));
                            scene.add(ResultCubes[ResultCubes.length - 1]);

                            // Highlight the current pooling region
                            poolCubes.forEach(cube => cube.material.color.set(0xff0000));

                            // Wait for 2 seconds (2000 milliseconds)
                            await wait(400, speed);
                        }
                    }
                }
            }
            return pooled;
        }


        async function flatten(array) {
            var lenz = array.length;
            var lenx = array[0].length;
            var leny = array[0][0].length;
            var arr = [];
            for (var i = 0; i < lenz; i++) {
                for (var j = 0; j < lenx; j++) {
                    for (var k = 0; k < leny; k++) {
                        arr.push(array[i][j][k]);
                    }
                }
            }
            return arr;
        }

        function NeuronCalc(x, y, b) {
            const l = x.length;
            var sum = 0;
            if (l == y.length) {
                for (let i = 0; i < l; i++) {
                    sum = sum + x[i] * y[i];
                }
            }
            else {
                console.log("LENGTH ISSUES");
                console.log(l);
                console.log(y.length);
            }
            if (sum + b >= 0) {
                return sum + b;
            } else {
                return 0;
            }

        }
        function ColorNorm(arr) {
            const min = Math.min(...arr); // Find the minimum value in the array
            const max = Math.max(...arr); // Find the maximum value in the array

            // Handle the edge case where all values in the array are the same
            if (min === max) {
                return arr.map(() => (0 + 255) / 2); // Return the midpoint of the range for all elements
            }

            // Normalize each value in the array to the range 0 to 255
            return arr.map(value => ((value - min) / (max - min)) * (255));
        }

        function createCylinder(point1, point2, scene) {
            const material = new THREE.MeshBasicMaterial({ color: 0x00d2d9, transparent: true });
            const direction = new THREE.Vector3().subVectors(point2, point1);
            const orientation = new THREE.Matrix4();
            orientation.lookAt(point1, point2, new THREE.Object3D().up);
            orientation.multiply(new THREE.Matrix4().makeRotationX(Math.PI / 2));
            const length = direction.length();
            const cylinderGeometry = new THREE.CylinderGeometry(0.1, 0.1, length, 32);
            const cylinder = new THREE.Mesh(cylinderGeometry, material);
            cylinder.applyMatrix4(orientation);
            cylinder.position.copy(point1).add(direction.multiplyScalar(0.5));
            cylinder.visible = false;
            scene.add(cylinder);
            return cylinder;
        }
